var pageNo = 0

class BiliComic {
  constructor(webObj) {
    this.epId = '';
    this.comicMsg = { "网站": webObj.name };
    this.imageList = [];
    this.keyPair = ""
    this.rawKey = ""
    this.jwkKey = ""
    this.getEpId()
    this.cleanCopyDom()
    this.zipFlag = false
  }
  //发送消息
  sendMsg(id, msg = {}) {
    process = id
    chrome.runtime.sendMessage({ id, data: { comicMsg: this.comicMsg, ...msg } });
  }
  //下载
  download() {
    this.zipFlag = false
    this.getImgToken()
  }
  downloadZip() {
    this.zipFlag = true
    this.getImgToken()
  }
  // 通过地址栏的链接获取到这一话的id
  getEpId() {
    let url = location.href.slice(0, location.href.indexOf("?"));
    this.epId = url.split("/")[url.split("/").length - 1];
    //生成密钥对
    window.crypto.subtle.generateKey(
      {
        name: "ECDH",
        namedCurve: "P-256", // 椭圆曲线 P-256
      },
      true, // 是否可以导出密钥
      ["deriveKey", "deriveBits"] // 密钥用途
    ).then((r) => {
      this.keyPair = r
      //导出公钥 ArrayBuffer(65)
      window.crypto.subtle.exportKey(
        "raw", // 导出为原始格式
        this.keyPair.publicKey
      ).then(r => {
        this.rawKey = r
        //导出私钥
        window.crypto.subtle.exportKey(
          "jwk", // 导出为 JWK 格式
          this.keyPair.privateKey
        ).then(r => {
          this.jwkKey = r
          this.getComicInfo()
        })
      })
    }
    )
  }
  getComicInfo() {
    fetch("https://manga.bilibili.com/twirp/comic.v1.Comic/GetEpisode?device=pc&platform=web", {
      "headers": {
        "content-type": "application/json;charset=UTF-8",
        "referrerPolicy": "strict-origin-when-cross-origin",
      },
      "body": JSON.stringify({ id: this.epId }),
      "method": "POST",
      "mode": "cors",
      "credentials": "include"
    })
      .then(r => r.json())
      .then(response => {
        this.comicMsg['漫画名'] = response.data.comic_title
        this.comicMsg[`单集数`] = "第" + response.data.short_title + "话"
        this.comicMsg[`标题`] = response.data.title
        this.getImageList()
      })
  }
  // 获取图片列表 (发送漫画信息)
  getImageList() {
    fetch("https://manga.bilibili.com/twirp/comic.v1.Comic/GetImageIndex?device=pc&platform=web", {
      "headers": {
        "content-type": "application/json;charset=UTF-8",
        "referrerPolicy": "strict-origin-when-cross-origin",
      },
      "body": JSON.stringify({ epId: this.epId }),
      "method": "POST",
      "mode": "cors",
      "credentials": "include"
    })
      //这是一种异步写法，then发生在上面的fetch请求有返回结果以后，response就是返回值，.json是把返回值转成json对象
      .then(r => r.json())
      .then(response => {
        // 获得res中的图片地址信息
        this.imageList = response.data.images
        this.comicMsg[`总页数`] = this.imageList.length <= 2 ? '未购买' : this.imageList.length
        //发送消息
        this.sendMsg(1)
      })
  }
  //通过图片列表的地址，获取真实图片链接和token
  getImgToken(imageList = this.imageList) {
    let imgList = []
    for (let i = 0; i < imageList.length; i++) {
      imgList.push(imageList[i].path)
    }

    fetch("https://manga.bilibili.com/twirp/comic.v1.Comic/ImageToken?device=pc&platform=web&nov=25", {
      "headers": {
        "accept": "application/json, text/plain, */*",
        "content-type": "application/json;charset=UTF-8",
      },
      "referrerPolicy": "strict-origin-when-cross-origin",
      "body": JSON.stringify({ m1: btoa(String['fromCharCode'].apply(null, new Uint8Array(this.rawKey))), urls: JSON.stringify(imgList) }),
      "method": "POST",
      "mode": "cors",
      "credentials": "include"
    }).then(r => r.json())
      .then(r => {
        this.sendMsg(2, { allPage: imageList.length, nowPage: 0 })
        this.downloadUrlList = []
        //循环一下，把每个地址组合
        for (let i = 0; i < r.data.length; i++) {
          //下载 
          this.downloadUrlList.push(r.data[i].complete_url)
        }
        // downloadByFetch(downloadUrlList, this)
        this.downloadImg()
      })
  }

  downloadImg(page = 1) {
    let url = this.downloadUrlList
    pageNo = page
    if (url.length == 0) {
      if (this.zipFlag) {
        zip.generateAsync({ type: "blob" })
          .then((content) => {


            var a = document.createElement('a');
            a.href = URL.createObjectURL(content);
            a.download = this.comicMsg['漫画名'] + "-" + this.comicMsg[`单集数`] + "-" + this.comicMsg[`标题`] + ".zip";
            document.body.appendChild(a);
            a.click();
            document.body.removeChild(a);
            this.sendMsg(4)
          });
      } else {
        this.sendMsg(4)
      }
      return 0
    }
    this.sendMsg(2, { allPage: this.imageList.length, nowPage: page })
    //解码图片
    console.log(this.downloadUrlList[0])
    console.log(btoa(JSON['stringify'](this.jwkKey)))

    render_hw(this.downloadUrlList.splice(0, 1)[0], btoa(JSON['stringify'](this.jwkKey)))
  }
  cleanCopyDom() {
    let list = document.getElementsByClassName("bullet-screen")
    for (let i = list.length - 1; i >= 0; i--) {
      list[i].remove()
    }
    listenDomChange(document.getElementsByClassName("image-container")[0], () => {
      let list = document.getElementsByClassName("bullet-screen")
      for (let i = list.length - 1; i >= 0; i--) {
        list[i].remove()
      }
    })
  }
}

function _loadImage_(url) {
  let image = new Image();
  image.src = url
  image.onload = (e) => {
    let canvas = document.createElement("canvas")
    let ctx = canvas.getContext('2d')
    //绘制
    canvas.width = image.width
    canvas.height = image.height
    ctx.drawImage(image, 0, 0)
    if (downloader.zipFlag) {
      zip.file(pageNo < 10 ? '0' + pageNo + ".jpg" : pageNo + ".jpg", canvas.toDataURL("image/jpg").split(',')[1], { base64: true });
    } else {
      a_dom.href = canvas.toDataURL("image/jpg")
      a_dom.download = pageNo < 10 ? '0' + pageNo + ".jpg" : pageNo + ".jpg";
      a_dom.click()
      downloader.downloadImg(pageNo + 1)
    }
  }
}

